	private static void runRandom() throws IOException {

		for (int i = 0; i < 100; i++) {

			int numberOfTaxa = 25;
			int seqLength = 500;
			double u = 0.015;
			int numOfTrees = 1;
			int numOfSPRs = 1;
			int numOfSPRTrees = 1;
			boolean addUniqueTaxa = false;

			int maxBranchLength = (int) Math.ceil(Math.sqrt(new Double(numberOfTaxa))) * 10;
			Object[] result = new Simulation_Manager().run(numberOfTaxa, maxBranchLength, seqLength, numOfTrees, numOfSPRTrees, numOfSPRs, u);

			MyTree speciesTree = (MyTree) result[0];
			ArrayList<MyTree> geneTrees = (ArrayList<MyTree>) result[1];
			ArrayList<String> taxaOrdering = (ArrayList<String>) result[2];
			new Distortion_Manager().run(speciesTree, geneTrees, taxaOrdering, addUniqueTaxa, 0);

			// if (conflictingTrees.size() != 1)
			// System.exit(0);
			System.out.println();

		}

	}

